function lookUp(verb, pronoun,tense) {
    console.log(verb, pronoun, tense);
 return window.database[tense][verb][getConj(pronoun)];
}

function getConj(p) {
    if(p == "yo") return 0;
    if(p == "tú") return 1;
    if(p == "él" || p == "ella" || p == "usted") return 2;
    if(p == "nosotros") return 3;
    if(p == "vosotros") return 4;
    if(p == "ustedes" || p == "ellas" || p == "ellos") return 5;
    p = p.split(" ");
    if(p.length == 3 && p[1] == "y") {
       if(p[2] == "yo") return 3;
       else {
        return 5;
       }
    }
    if(p.length == 1) return 2;
    return 9;
}

function getAnswer() {
    window.pronoun = getPronoun();

    window.verb = getVerb();
    var tense = window.tenseMap[window.activity_title.toLowerCase()];
    if(!tense) {
        showErrorElements();
        tense = window.tenseMap[window.selectEle.value];
    }
    
    if(tense == 1) {
        let actualTense = window.tenseMap2[getTenseInput()];
        return window.database[1][window.verb][actualTense][getConj(window.pronoun)];
    }
    if(tense >= 31) {
        let isPositive = (getTenseInput() == "positive");
        let ans = lookUp(window.verb, "yo",tense);
        ans = ans.split("/");
        if(isPositive) ans = ans[0];
        else ans = ans[1];
        return ans;

    }
    var answer = lookUp(window.verb, window.pronoun, tense);
    return answer;
}

function solve() {
    window.ansElement = document.getElementById('answer-input')
    if(!window.ansElement) {
        window.ansElement = document.getElementById('assignment-answer-input')
    }
    var answer = getAnswer();
    window.ansElement.focus();
    window.ansElement.value = answer;
}

function verbInputExists() {
    var a = document.getElementById('verb-input');
    if(a && a.className != "ghost") return true;
    return false;
}



function getPronoun() {
    return document.getElementById("pronoun-input").innerHTML.trim();
}

function getVerb() {return document.getElementById("verb-input").innerHTML}

function getTenseInput() {
    return document.getElementById("tense-input").innerHTML;
}

function addOption(value) {
    let option = document.createElement("option");
    option.value = value;
    option.innerText = value;
    window.selectEle.appendChild(option);
}


function showErrorElements() {
    window.errEle.style.display = "block";
    window.selectEle.style.display = "block";
}

function hideErrorElements() {
    window.errEle.style.display = "none";
    window.selectEle.style.display = "none";
}


window.pronoun;
window.verb;


function start() {
    if(verbInputExists()) {
        solve();
    } else {
        setTimeout(start, 500);
    }
} 



document.onkeypress = function(e) {
    e = e || window.event;
    if(e.keyCode == 13) {
        solve();
    }
}

